import React from "react";
import AboutImg from './image/about-img.png'

const About = () => {
  return(
    <section className="about">
      <div className="container">
        <div className="about__wrapper">
          <img src={AboutImg} />
        </div>
      </div>
    </section>
  );
}

export default About;
